export default function Informatique() {
	return (
		<div className='informatique'>
			<span>
				Je découvre régulièrement de nouveaux langages de programmation à travers des miniprojets personnels ou
				pour des proches.
				<br />
				<br />
				Je passe une grande partie de mon temps libre à coder ou à apprendre à coder.
			</span>
		</div>
	);
}
